import React from "react";
import { Link } from "react-router-dom";
import Logo from "../image/Logo.png";

const CartoonDetail = (props) => {
  return (
    <div className="cartoon-detail">
      <Link to="/">Volver</Link>
      <img className="logo" src={Logo} alt="logo" />
      <img src={props.cartoon.image} atl={props.cartoon.name} />
      <h1>{props.cartoon.name}</h1>
      <ul>
        <li>{props.cartoon.status}</li>
        <li>{props.cartoon.species}</li>
        <li>{props.cartoon.planet}</li>
        <li> {props.cartoon.episodes}</li>
      </ul>
    </div>
  );
};

export default CartoonDetail;
